                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>&nbsp;</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Selain fasilitas bongkar muat,
                                Pelabuhan Marunda juga dilengkapi dengan berbagai fasilitas navigasi yang mendukung
                                keselamatan pelayaran serta operasional pelabuhan selama 24 jam. Salah satu elemen navigasi
                                yang tersedia adalah lampu suar, yang berjumlah 2 unit dan telah beroperasi sejak tahun
                                2014. Lampu suar berperan krusial dalam memberikan panduan bagi kapal yang mendekati
                                pelabuhan, terutama pada malam hari atau dalam kondisi cuaca buruk yang dapat membatasi
                                visibilitas. Keberadaan lampu suar ini memastikan bahwa kapal dapat berlayar dengan aman dan
                                mengurangi risiko kecelakaan di perairan sekitar pelabuhan. Selain itu, pelabuhan juga
                                memiliki 16 unit lampu penerangan jalan yang telah dipasang sejak tahun 2012. Lampu
                                penerangan ini sangat penting dalam mendukung aktivitas bongkar muat serta pergerakan
                                kendaraan di dalam kawasan pelabuhan pada malam hari, sehingga operasional dapat berjalan
                                tanpa kendala akibat kurangnya pencahayaan. Untuk meningkatkan keselamatan pelayaran dan
                                operasional, pelabuhan juga menyediakan 8 unit pelampung, yang berfungsi sebagai alat bantu
                                keselamatan dan navigasi bagi kapal dan kru yang bekerja di sekitar pelabuhan.</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Dari segi kondisi dan
                                pemanfaatan fasilitas, seluruh peralatan dan infrastruktur yang tersedia di Pelabuhan
                                Marunda berada dalam kondisi baik dan sudah dimanfaatkan sepenuhnya. Hal ini menunjukkan
                                kesiapan pelabuhan dalam mendukung arus perdagangan dan logistik yang semakin meningkat.
                                Namun, seiring dengan pertumbuhan volume barang dan lalu lintas kapal, terdapat beberapa
                                aspek yang dapat ditingkatkan guna menjaga efisiensi dan daya saing pelabuhan. Salah satunya
                                adalah penambahan jumlah fasilitas, seperti lampu suar dan tug boat, untuk mengakomodasi
                                peningkatan jumlah kapal yang berlabuh. Selain itu, modernisasi peralatan bongkar muat
                                dengan teknologi terbaru juga perlu dilakukan agar produktivitas dapat meningkat dan waktu
                                bongkar muat menjadi lebih singkat. Evaluasi dan pemeliharaan berkala terhadap semua
                                fasilitas juga menjadi faktor penting agar seluruh peralatan tetap berfungsi optimal dan
                                dapat digunakan dalam jangka panjang.</span>
                        </p>
                        <p><span style='font-size:16px;'>Secara keseluruhan, Pelabuhan
                                Marunda memiliki fasilitas bongkar muat dan navigasi yang cukup lengkap serta dalam kondisi
                                baik untuk mendukung kelancaran operasional. Keberadaan excavator, forklift, tug boat, lampu
                                suar, dan pelampung menjadikan pelabuhan ini mampu melayani berbagai jenis kapal dan muatan
                                dengan efisien. Dengan infrastruktur yang tersedia, Pelabuhan Marunda dapat terus berkembang
                                menjadi pusat logistik yang lebih kompetitif dan mampu memenuhi kebutuhan perdagangan serta
                                transportasi laut secara optimal. Namun, guna menghadapi pertumbuhan aktivitas pelabuhan di
                                masa mendatang, perlu adanya peningkatan kapasitas dan modernisasi fasilitas agar pelabuhan
                                dapat terus bersaing dan memberikan layanan yang lebih baik kepada para pengguna jasa
                                kepelabuhanan.</span></p>
                    </div>

                    <div class="tab-pane fade" id="fasilitaspokok" role="tabpanel" aria-labelledby="profile-tab">
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Pelabuhan Marunda merupakan
                                salah satu pelabuhan strategis di Indonesia yang memiliki berbagai fasilitas pokok dan
                                penunjang untuk mendukung kelancaran operasionalnya. Dalam mendukung aktivitas perdagangan
                                dan logistik, fasilitas pokok penunjang lainnya di pelabuhan ini mencakup berbagai
                                infrastruktur yang menunjang administrasi, transportasi, keamanan, keselamatan, hingga
                                pengelolaan lingkungan. Salah satu fasilitas yang menjadi bagian penting dari operasional
                                pelabuhan adalah fasilitas perkantoran yang terdiri dari kantor pusat (Head Office) dan
                                kantor operasional (Operational Office). Kantor pusat berfungsi sebagai pusat administrasi
                                dan manajemen utama pelabuhan, sementara kantor operasional digunakan untuk menangani
                                kegiatan harian, termasuk pengelolaan logistik serta koordinasi antarunit di dalam
                                pelabuhan. Dengan jumlah masing-masing satu dan tiga unit, serta kondisi yang baik,
                                fasilitas ini telah beroperasi dengan optimal sejak tahun 2012 dan 2014.</span>
                        </p>
