                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>&nbsp;</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Selain fasilitas administrasi,
                                keberadaan sarana transportasi internal juga menjadi bagian penting dalam mendukung
                                pergerakan tenaga kerja dan pengunjung di area pelabuhan. Pelabuhan Marunda memiliki sepuluh
                                halte bus (bus stop) yang telah dibangun sejak tahun 2019 dan dalam kondisi baik, serta satu
                                unit shuttle bus yang berfungsi untuk mengangkut pekerja dari satu titik ke titik lainnya di
                                dalam pelabuhan. Meskipun jumlah shuttle bus yang tersedia masih terbatas, keberadaan halte
                                bus yang mencukupi menjadi solusi bagi efisiensi mobilitas pekerja maupun tamu yang
                                beraktivitas di kawasan pelabuhan.</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Di samping itu, fasilitas
                                teknis yang mendukung transfer barang juga telah tersedia dengan baik. Pelabuhan Marunda
                                memiliki jalur pipa (pipeline) sepanjang 2.100 meter serta 30 unit pipa penyalur yang
                                digunakan untuk mendistribusikan cairan seperti minyak dan bahan kimia ke kapal atau gudang
                                penyimpanan. Untuk mendukung proses bongkar muat bahan cair ini, pelabuhan juga dilengkapi
                                dengan dua unit Liquid Transfer Station (LTS) tetap dan lima unit LTS bergerak. Fasilitas
                                ini memungkinkan pelabuhan untuk melakukan transfer bahan cair dengan aman dan efisien,
                                sekaligus mengurangi risiko pencemaran lingkungan akibat kebocoran atau tumpahan
                                cairan.</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Dari aspek lingkungan dan
                                keselamatan, Pelabuhan Marunda juga telah menyediakan berbagai fasilitas yang mendukung
                                kebersihan, keamanan, serta keselamatan kerja. Ketersediaan pasokan air bersih (Fresh Water
                                Supply) menjadi salah satu komponen penting untuk mendukung operasional harian, baik untuk
                                kebutuhan pekerja maupun keperluan teknis di area pelabuhan. Selain itu, fasilitas
                                pengelolaan sampah atau Garbage Removal telah disediakan dengan jumlah empat unit dan dalam
                                kondisi baik, sehingga limbah yang dihasilkan dapat dikelola secara optimal. Untuk mendukung
                                kelangsungan operasi kapal, pelabuhan ini juga memiliki fasilitas bunkering atau pengisian
                                bahan bakar yang disediakan melalui satu unit kapal yang berfungsi sebagai sumber bahan
                                bakar bagi kapal-kapal yang bersandar.</span>
                        </p>
                        <p
                            style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;;text-align:justify;text-indent:18.0pt;line-height:normal;'>
                            <span style='font-size:16px;'>Dalam hal pengamanan, Pelabuhan
                                Marunda memiliki sistem keamanan berlapis yang terdiri dari tiga unit Security Gate Pass
                                sebagai gerbang kontrol akses utama, 40 unit kamera pengawas (CCTV) yang tersebar di seluruh
                                area pelabuhan, serta satu unit mobil patroli yang digunakan untuk pengamanan secara mobile.
                                Dengan sistem ini, aktivitas di pelabuhan dapat dipantau secara real-time, sehingga berbagai
                                risiko keamanan seperti pencurian, pelanggaran akses, atau kejadian darurat dapat
                                diantisipasi dengan cepat. Selain itu, pelabuhan ini juga dilengkapi dengan sistem hydrant
                                yang berfungsi sebagai alat pemadam kebakaran dalam kondisi darurat, serta dilengkapi dengan
                                oil boom yang berperan dalam menangani tumpahan minyak untuk mencegah pencemaran
                                laut.</span>
                        </p>
                        <p><span style='font-size:16px;'>Fasilitas tambahan lainnya yang
                                mendukung operasional di pelabuhan ini mencakup toilet bagi pekerja dan pengunjung, fender
                                sebanyak 10 unit yang digunakan untuk meredam benturan kapal dengan dermaga, jembatan
                                timbang sebanyak tiga unit dengan kapasitas masing-masing 100 ton yang digunakan untuk
                                mengukur berat muatan sebelum atau setelah bongkar muat, serta bollard sebanyak delapan unit
                                yang berfungsi sebagai tempat penambatan kapal agar tetap berada di posisi yang aman saat
                                bersandar. Seluruh fasilitas ini telah dibangun dalam kurun waktu antara tahun 2014 hingga
                                2023 dan dalam kondisi baik, yang menunjukkan bahwa Pelabuhan Marunda memiliki kesiapan yang
                                optimal dalam mendukung operasional dan keselamatan kerja.</span></p>
                    </div>

                    <div class="tab-pane fade" id="dataoperasional" role="tabpanel" aria-labelledby="profile-tab">
                        <p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;text-indent:18.0pt;line-height:normal;'><span style='font-size:16px;'>Kegiatan operasional di Pelabuhan Marunda menunjukkan dinamika yang signifikan dalam berbagai aspek, mulai dari muatan bongkar muat, kunjungan kapal, hingga total kapasitas muatan kapal yang masuk. Grafik muatan bongkar muat (B/M) menggambarkan fluktuasi volume muatan yang cukup tajam sepanjang periode yang dianalisis. Volume muatan terendah tercatat pada angka 910.037, sementara volume tertinggi mencapai 1.417.871. Perubahan dari bulan ke bulan juga cukup bervariasi, dengan beberapa bulan mengalami penurunan seperti sebesar 9% pada satu periode dan 13% di periode lainnya. Namun, terdapat pula lonjakan signifikan hingga 27% dalam satu bulan tertentu, serta kenaikan 18% pada periode lainnya. Fluktuasi ini dapat mengindikasikan adanya faktor eksternal yang mempengaruhi, seperti musim perdagangan, kondisi ekonomi, atau bahkan kebijakan ekspor-impor yang berdampak langsung pada aktivitas bongkar muat di pelabuhan.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;text-indent:18.0pt;line-height:normal;'><span style='font-size:16px;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;'>&nbsp;<img src="data:image/png;base64," style="text-align:center; width: 444.75pt; height: 229.5pt; margin-left: 20%" alt="image"></span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Sementara itu, jumlah kunjungan kapal ke Pelabuhan Marunda juga menunjukkan pola yang serupa, dengan jumlah kapal terendah tercatat sebanyak 598 kapal dan jumlah tertinggi mencapai 967 kapal dalam satu bulan tertentu. Dari grafik terlihat bahwa jumlah kunjungan kapal mengalami penurunan 9% pada suatu periode, namun kemudian meningkat sebesar 8% pada bulan berikutnya. Ada pula penurunan cukup signifikan sebesar 15% di salah satu bulan, sebelum akhirnya mengalami kenaikan tajam sebesar 24% dalam periode lainnya. Fluktuasi ini menunjukkan bahwa aktivitas pelabuhan tidak selalu stabil dan dipengaruhi oleh berbagai faktor seperti kepadatan pelabuhan, kondisi cuaca yang mungkin menghambat kedatangan kapal, serta faktor regulasi yang mempengaruhi pergerakan kapal dari dan ke pelabuhan.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;'><img src="data:image/png;base64," style="width: 444.75pt; height: 228.75pt;margin-left: 20%" alt="image"></span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Selain itu, grafik mengenai kapasitas muatan kapal atau Deadweight Tonnage (DWT) juga memperlihatkan tren perubahan yang serupa. Kapasitas muatan kapal terendah tercatat sebesar 1.422.922 ton, sementara kapasitas tertinggi mencapai 2.497.492 ton. Dari segi perubahan, terdapat penurunan sebesar 4% dalam satu bulan, diikuti dengan kenaikan 8% pada periode berikutnya. Namun, terdapat juga penurunan yang lebih besar, yakni sebesar 12%, sebelum akhirnya mengalami lonjakan yang cukup drastis sebesar 44% dalam satu bulan tertentu. Hal ini menunjukkan bahwa meskipun jumlah kapal yang masuk ke pelabuhan bervariasi, total kapasitas muatan yang dibawa oleh kapal-kapal tersebut juga mengalami perubahan yang tidak selalu sejalan dengan jumlah kunjungan kapal. Bisa jadi dalam satu bulan terdapat lebih banyak kapal berkapasitas kecil, sementara di bulan lain, kapal dengan kapasitas besar lebih mendominasi.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;'><img src="data:image/png;base64," alt="image" width="620" height="319" style="margin-left: 20%"></span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>Secara keseluruhan, analisis dari ketiga grafik ini mengungkapkan bahwa operasional di Pelabuhan Marunda mengalami perubahan yang cukup dinamis dari waktu ke waktu. Naik turunnya jumlah muatan bongkar muat, kunjungan kapal, serta kapasitas muatan kapal yang datang menunjukkan bahwa terdapat berbagai faktor yang berperan dalam aktivitas pelabuhan ini. Fluktuasi yang terjadi dapat disebabkan oleh faktor ekonomi global, kebijakan perdagangan, perubahan musim, ataupun kondisi logistik secara umum. Untuk mendapatkan pemahaman yang lebih mendalam mengenai penyebab dari perubahan ini, analisis lebih lanjut dapat dilakukan dengan melihat faktor eksternal seperti tren ekspor-impor, kebijakan pelayaran, serta faktor cuaca dan infrastruktur pelabuhan yang dapat berpengaruh terhadap kelancaran operasional di Pelabuhan Marunda.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;line-height:107%;'>&nbsp;</span></p>
