<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;'>&nbsp;</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;'>Berdasarkan tabel yang berisi analisa muatan dan kunjungan kapal di Pelabuhan Marunda sepanjang tahun 2024, dapat terlihat pola aktivitas&nbsp;</span><span style='font-size:16px;line-height:107%;'>operasional</span><span style='font-size:16px;'>&nbsp;yang mengalami fluktuasi dari bulan ke bulan. Dari data kunjungan kapal, jumlah kapal yang masuk ke pelabuhan bervariasi, dengan jumlah terendah terjadi pada bulan April, yakni sebanyak 598 kapal, sementara jumlah tertinggi tercatat pada bulan November dengan 967 kapal. Secara umum, jumlah kapal yang masuk cenderung meningkat pada pertengahan hingga akhir tahun. Daya angkut kapal yang masuk juga mengalami pola serupa, dengan Deadweight Tonnage (DWT) terendah pada bulan April sebesar 1.422.922 ton dan tertinggi pada bulan Oktober mencapai 2.497.492 ton. Hal ini menunjukkan bahwa meskipun jumlah kapal tidak selalu dalam tren naik, ada kecenderungan kapal dengan kapasitas lebih besar datang pada bulan-bulan tertentu, terutama menjelang akhir tahun.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;'><span style='font-size:16px;'>Dari sisi ukuran kapal, parameter LOA (Length Overall) dan DRAFT menunjukkan adanya variasi dalam ukuran kapal yang masuk ke Pelabuhan Marunda. Panjang kapal (LOA) minimum bervariasi dari 13 hingga 21 meter, sedangkan maksimum umumnya mencapai 109 meter, kecuali pada bulan Oktober yang mencatat panjang kapal maksimum sebesar 122 meter. Kedalaman draft kapal juga relatif stabil, dengan rata-rata berkisar antara 3,37 hingga 3,58 meter. Perbedaan ukuran kapal ini menunjukkan adanya diversifikasi dalam jenis kapal yang berlabuh, yang dapat mencerminkan variasi dalam jenis muatan yang dibawa.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;'>Asal dan tujuan kapal yang paling dominan menunjukkan hubungan perdagangan yang erat antara Pelabuhan Marunda dengan beberapa pelabuhan lainnya. Sepanjang tahun, pelabuhan asal kapal yang paling banyak masuk ke Marunda adalah dari ARJUNA dan JAVA, serta beberapa dari Palembang dan Pontianak. Sementara itu, untuk tujuan pengiriman, kapal yang keluar dari Pelabuhan Marunda sebagian besar menuju ke lokasi yang sama, yaitu Palembang, Pontianak, dan Bojonegara. Pola ini menunjukkan adanya jalur pelayaran yang stabil dan menjadi andalan bagi arus barang yang keluar dan masuk ke pelabuhan.</span></p>
<p style='margin-top:0cm;margin-right:0cm;margin-bottom:.0001pt;margin-left:0cm;font-size:11.0pt;font-family:"Aptos",sans-serif;text-align:justify;text-indent:36.0pt;'><span style='font-size:16px;'>Dari segi jenis muatan, batu bara mendominasi muatan yang dibongkar di Pelabuhan Marunda sepanjang tahun, dengan volume tertinggi tercatat pada bulan Oktober sebesar 1.417.871 ton. Selain batu bara, muatan utama lainnya yang juga sering dibongkar adalah Crude Palm Oil (CPO) dan pasir. Terdapat beberapa bulan di mana urutan dominasi muatan mengalami sedikit perubahan, seperti pada bulan Agustus dan September ketika pasir berada di posisi kedua setelah batu bara, sementara Crude Palm Oil bergeser ke posisi ketiga. Selain itu, bulan Desember menjadi pengecualian karena tidak ada aktivitas muatan bongkar, tetapi tercatat adanya muatan alat berat, amonium nitrat, dan B35. Hal ini kemungkinan disebabkan oleh adanya pergeseran operasional atau perubahan pola perdagangan di akhir tahun.</span></p>
<p><span style='font-size:16px;'>Secara keseluruhan, tabel ini memberikan gambaran jelas mengenai dinamika operasional di Pelabuhan Marunda sepanjang tahun 2024. Jumlah kapal yang masuk dan kapasitas muatannya mengalami variasi yang cukup signifikan, dengan tren peningkatan pada kuartal terakhir tahun. Arus pelayaran menunjukkan pola yang stabil dengan hubungan erat antara Marunda dan pelabuhan lain seperti Palembang dan Pontianak. Dominasi batu bara sebagai muatan utama juga mengindikasikan bahwa Pelabuhan Marunda memainkan peran penting dalam rantai distribusi komoditas energi dan bahan mentah. Dengan melihat pola-pola ini, dapat dilakukan analisa lebih lanjut mengenai faktor-faktor yang mempengaruhi perubahan aktivitas pelabuhan, seperti kebijakan perdagangan, kondisi cuaca, atau faktor ekonomi yang lebih luas.</span></p>
